# Drizzle on D1

Drizzle is an ORM that helps you use your D1 database in a straightforward way. Instead of writing SQL yourself, you define your tables in TypeScript, and Drizzle handles the SQL behind the scenes.

## Install Drizzle

### Install Drizzle

You need the following packages:

* `drizzle-orm` – the core ORM library

```bash
npm i drizzle-orm
```

## Configure Wrangler

### Configure Wrangler

Open your `wrangler.jsonc` and make sure it includes a "d1_databases" block like this:

```json
{
  "$schema": "node_modules/wrangler/config-schema.json",
  "name": "YOUR_APP_NAME",
  "main": "src/index.ts",
  "compatibility_date": "2025-04-18",
  "observability": {
    "enabled": true
  },
  "d1_databases": [
    {
      "binding": "DB",
      "database_name": "YOUR_DB_NAME",
      "database_id": "YOUR_DB_ID,
    }
  ],
}
```

This tells Wrangler about your database and where it should look for migrations.

## Run Your First Query

### Run Your First Query

Below is a simple Workers script you can place in `src/index.ts`. It shows you how to connect to the database, create a table, insert a row, and query all rows.

```
import { drizzle } from 'drizzle-orm/d1';
import { sqliteTable, text, integer } from 'drizzle-orm/sqlite-core';
import { sql } from 'drizzle-orm';

// 1) Define the users table
const users = sqliteTable('users', {
  id: integer('id').primaryKey({ autoIncrement: true }),
  name: text('name').notNull(),
});

// 2) Describe your Env interface
export interface Env {
  DB: D1Database;
}

export default {
  async fetch(request: Request, env: Env) {
    const db = drizzle(env.DB);
    const url = new URL(request.url);

    // Route to create the users table if it doesn't exist
    if (url.pathname === '/setup') {
      await db.run(sql`
        CREATE TABLE IF NOT EXISTS users (
          id INTEGER PRIMARY KEY AUTOINCREMENT,
          name TEXT NOT NULL
        )
      `);
      return new Response('Table created or already exists!');
    }

    // Route to add a test user
    if (url.pathname === '/add') {
      const newUser = await db.insert(users)
        .values({ name: 'Test User' })
        .returning()
        .get();

      return Response.json(newUser);
    }

    // Route to get all users
    if (url.pathname === '/users') {
      const allUsers = await db.select().from(users).all();
      return Response.json(allUsers);
    }

    // Default route
    return new Response('D1 Connected!');
  },
};
```

**Explanation of Endpoints:**

* `/setup`: Creates the users table (if it doesn't already exist).  
* `/add`: Inserts a user named "Test User" and returns that row in JSON.  
* `/users`: Returns all rows in JSON.

## That's It!

### That's It!

You now have a simple setup for using Drizzle with D1. Feel free to expand on this code and use more advanced features as your application grows. Interested in learning more? Join us in discord.

